import React from "react"
import Block from "./Block"

function BlocksRow(props) {
    const row = []
    for (let index = 0; index < 8; index++) {
        let id = index % 2 + props.id
        row.push(<Block color = {String(id)}/>)
      }
    return (
        <div>
            <tr>
                {row}
            </tr>
        </div>
    )
}

export default BlocksRow
